import React from "react";
import UsersList from "../components/UsersList";

const Users = () => {
    const USERS = [
        {id: 'Some random guy', image: 'https://www.google.com/url?sa=i&url=https%3A%2F%2Fwww.pexels.com%2Fsearch%2Fperson%2F&psig=AOvVaw3M2wvP4K605FPbWS7bdaMG&ust=1668276784372000&source=images&cd=vfe&ved=0CBAQjRxqFwoTCPiX87vdpvsCFQAAAAAdAAAAABAD', places: 3}
    ];


    return <UsersList items={USERS}/>
};

export default Users;
